INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-416.5, 105901, 1, 0.0, 1, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 42001, 0, "2030/12/17 14:59:59", 42, 0.0, "コッコロ", 1, "2015/12/17 15:00:00", 0);
