INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 105901, 1, 0.0, 1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43002, 0, "2030/12/17 14:59:59", 43, 0.0, "コッコロ", 1, "2015/12/17 15:00:00", 0);
